        "body": "Regarding the `dist` folder, it serves as namespace for minified files. The current workflow produces a lot of unminified files (css and js), and of course, this leads to a increased use of bandwidth for the end-user. The `dist` simply does that, instead of calling each file from the `src` folder, the app now uses the minified version. I know is not the best soluci√≥n but the current workflow does not allow me to do any further changes without refactoring a lot of the functionality.\r\n\r\nAlso, I added a Gulp.js file for that. It copies the files from `src`, minifies the `css` and `js` files, contacts them and puts them in the `dist` folder for the app to get them from there.",
