        "body": "Main changes:\r\n- Main project folder is now 'dist' instead of 'src'\r\n- 'src' contains all the non production ready unminified files\r\n- Dependencies are now managed via Bower\r\n- Added Gulp for the packaging process (minification, lint, watchers)\r\n- The project now uses ui.bootstrap\r\n- bestMatch config option is no longer needed - removed from README\r\n- font-awesome.css and doc-widgets.css are no longer needed\r\n- fonts are no longer needed\r\n- Main template file has been updated and is now responsive\r\n- Some changes were made to src/example.js, see git diff for details",
