        "body": "Was this feature added already? I still getting a `File to import not found or unreadable` while importing a css file from my bower dependencies.\r\n\r\nUsing:\r\n`@import \"angular-material/angular-material.min\"`\r\n\r\nThe load path is right, since I can import `.scss` and `.sass` files."
