        "updated_at": "2015-02-28T14:57:16Z",
        "closed_at": null,
        "body": "This tool works great. But Bootstrap is very outdated. I also noticed the templates are as outdated as the Bootstrap version, since they use the old span# (span1, span2, span3, etc.) system.\r\n\r\nIs there any way to replace or update the templates and the Bootstrap version the project uses? I can contribute with that.\r\n\r\nM"
